import workoutsStore from "../stores/workoutsStore";
import React from 'react';
import Workout from "./Workout";

export default function Logs({logIn}) {
    const store = workoutsStore();

    return(
        <div>
            <h2>Logbooks:</h2>
            {store.workouts && store.workouts.map(workout => {
                return <Workout log={workout} key={workout._id} />
            })}
            <button onClick={() => store.toggleCreate()}>Create New Logbook</button>
        </div>
    );
}
